"     <a class=\"nounderline abstract\" href=\"UTD.htm?15/6/15459/abstract/1\">",
"      Greco FA, Hainsworth JD. Introduction: unknown primary cancer. Semin Oncol 2009; 36:6.",
"     </a>",
