"     <a class=\"nounderline abstract\" href=\"UTD.htm?15/6/15459/abstract/3\">",
"      French CA. Pathogenesis of NUT midline carcinoma. Annu Rev Pathol 2012; 7:247.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?15/6/15459/abstract/4\">",
"      Bauer DE, Mitchell CM, Strait KM, et al. Clinicopathologic features and long-term outcomes of NUT midline carcinoma. Clin Cancer Res 2012; 18:5773.",
"     </a>",
